import React from 'react'
import { StyleSheet, Text, View, ScrollView, Image } from 'react-native'

const WelcomeScreen = () => {
    return (
        <ScrollView>
            <Image />
            <View>
            <Text></Text>
            </View>
        </ScrollView>
    )
}

export default WelcomeScreen

const styles = StyleSheet.create({})
